import React from 'react';
import ReactDOM from 'react-dom';
//import './index.css';
import App from './App'
import * as serviceWorker from './serviceWorker';
//import $ from 'jquery';
//import $ from 'jquery';
//import './css/jquery.mobile-1.2.1.min.css';

//ReactDOM.render(<App />, document.getElementById('root'));

window.webservices="";
//window.webservices="";
//window.webservices="";


const startApp = () => {
  ReactDOM.render(
    <App />,
    document.getElementById('root')
  );
}
//
//  alert(window.cordova);
//  alert(JSON.stringify(window.cordova));

if (!window.cordova) {
  startApp()
} else {
  document.addEventListener('deviceready', () => {
    document.addEventListener("backbutton"
      , (e) => {
        window.closeOrBack();
      //  alert("Android back button"+JSON.stringify(e));
         // navigator.app.exitApp();
      }
      , false);
    startApp();
  }, false);
  // alert(deevice.cordova);

  // window.device && device.platform === 'iOS'? 
  //  alert(window.device.platform);
  // alert(window.cordova);
  //  alert(JSON.stringify(window.cordova));
}



